import Head from 'next/head'

import { Table, Tag, Space } from 'antd';

const Index = (props) => {



  const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
      render: text => <a>{text}</a>,
    },
    {
      title: 'Age',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
  ];




  const data = [
    {
      key: '1',
      name: 'John Brown',
      age: 32,
      address: 'New York No. 1 Lake Park',
    },
    {
      key: '2',
      name: 'Jim Green',
      age: 42,
      address: 'London No. 1 Lake Park',
    },
    {
      key: '3',
      name: 'Joe Black',
      age: 32,
      address: 'Sidney No. 1 Lake Park'
    },
  ];

  return (
    <>

      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      {/* The Main Body */}
      <section className="main">

        <div className="right">
          {/* Earning Table */}
          <Table columns={columns} dataSource={data} />
        </div>
        <div className="left">
          {/* Expense Table */}
          <Table columns={columns} dataSource={data} />
        </div>

      </section>

    </>
  );
}

export default Index;
